import logo from "./logo.svg";
import "./App.css";

function App() {
  return (
    <div className="App">
      <header>
        <nav className="flex">
          <div className="logo">
            <img src={logo} alt="" />>
          </div>
        </nav>
      </header>
    </div>
  );
}

export default App;
